package Operators;

public class UnaryOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int x = 10;
		int y = 20;
		
		int Results = +x;
		System.out.println("+X = "+ Results);
		
		
		Results = -y;
		System.out.println("-Y = "+ Results);
		
		
		Results = ++x;
		System.out.println("++X = "+ Results);
		
		
		Results = --y;
		System.out.println("--Y = "+ Results);
		
		
		boolean XYZ = false;
		System.out.println(!XYZ);
		
		
		
	}

}
